import numpy as np
from numpy.linalg import norm
import math

def calc_similarity(input_data, robot_count, attack = False): 
    source_data_list = input_data.split()[-1*robot_count:]
    xy_list = []
    for xy in source_data_list:
        xy_list.append(xy.split(":"))
    final_list = []
    for item in xy_list:
        final_list.append(np.array([float(item[-2]), float(item[-1])]))
    
    distance = []
    final_list = np.array(final_list)
    final_list.sort(0)
    print(final_list)
    for i in range(0, len(final_list)): # enumerate over all the points in the list
        # calculate the ideal position of each point.
        if not attack:
            ideal = (final_list[-1]-final_list[0])/(robot_count-1)*i + final_list[0]
        else:
            ideal = np.array([-0.3*(robot_count-1)/2+i*0.3, 0])
        print("ideal", ideal,"real", final_list[i])
        distance.append(norm(final_list[i]-ideal))
 #       print(distance)

#    for item in final_list:
#        distance.append(norm(np.cross(final_list[0]-final_list[-1], final_list[-1]-item))/norm(final_list[0]-final_list[-1]))

    average_distance = sum(distance)/len(distance)

    return math.e**(-1*average_distance)


